import React from 'react';
import SoicItems from './soicItems';

function Social () {
    return (
        <ul className="list-group">

            <SoicItems
                media="Facebook"

            />
            <SoicItems
                media="Youtub" />
            <SoicItems media = "Instegram"/>
            
        
      
            
      </ul>
    )
}


export default Social
